import React from 'react';
import classes from './DropDown.module.css';
const DropDown = props => {
  const passInfo = e => {
    e.preventDefault();
    props.fillInput(e);
    console.log(e.target.value);
  };
  return (
    <div>
      <div>
        {props.dataSource
          ? props.dataSource.data.map(city => {
            console.log(city);

              return (
                <button value={city}

                  onClick={passInfo}
                  className={classes.list}
                  name={city.id}
                >
                  {city.name}
                </button>
              );
            })
          : 'hi'}
      </div>
    </div>
  );
};

export default DropDown;
